import React, {Component} from 'react';
import {getCV} from "../api/apiCalls";


class CvList extends Component {



    state = {
        cvs: []
    };

    componentDidMount() {
        getCV().then(response => {
            this.setState({
                cvs: response.data.content
            });
        });
    }

    render() {
        const {cvs} = this.state;
        return (
            <div className="card">
                {cvs.map(cv => {
                    return (
                        <div key={cv.email}>
                            {cv.name}
                        </div>
                    );
                })}
            </div>
        );
    }
}

export default CvList;
